sources.styles/admin/components/_table.scss:
.search-table {

    table {
        border-color: $primary;
        thead {

            tr {
                background-color: $primary;
                border-color: $primary;

                font-size: 16px;
                th {
                    padding: 15px 20px;
                    border: solid;
                    border-width: 1px 1px 0 0;

                    &:nth-child(1) {
                        border-width: 1px 1px 0 1px;
                        border-radius: 10px 0 0 0;
                    }

                    &:nth-child(2) {
                        border-radius: 0 10px 0 0;
                    }


                    color: #f0f0f0;
                    border-color: $primary;
                }
            }
        }

        tbody {
            tr {
                font-size: 14px;
                &:hover {
                    cursor: pointer;
                    background-color: rgba($color: $primary, $alpha: 0.1);
                }

                td {
                    padding: 10px 20px;
                    border: solid;
                    border-width: 0 1px 1px 1px;

                    &:nth-child(n + 2)  {
                        border-left: 0px;
                    }
                }

                &:nth-child(1) {
                    td {
                        border-width: 1px 1px 1px 1px;
                    }
                }
            }
        }
    }

}

